import '../App.css';
import Footer from '../Components/Footer';
import BigHeading from '../Components/BigHeading';

function Blogs(){
    let element = null;
    if (true) {
        element = <input className='SearchInput' placeholder='Search'></input>
    }
    return(
        <div>
            <BigHeading NoImage={true} Title="Blogs" Content={element}/>
        </div>
    );
}

export default Blogs;
